  const brand=
  'https://img2.freepng.es/20180703/zaj/kisspng-logo-sprint-car-racing-auto-racing-toca-touring-car-championship-5b3b18d135dec9.7959186215305996332207.jpg';


  return (
    <header className={`header background--${background}`}>
      
      <div className="header-container">
        
        {/* Botón de menú  */}
        <div className="menu-button">
        <FontAwesomeIcon icon="fa-solid fa-bars" />
          <span>Menu</span>
        </div>
    <div>inicio</div>
    <div>Nosotros</div>
    <div>Productos</div>
    <CartWidget></CartWidget>
    </div>
    </header>

  )
}

export default NavBar
